const insertionSort = (unsortedArray) => {
  for (let i = 1; i < x.length; i++) {
    let current = x[i];
    let j = i - 1;
    while (j >= 0 && x[j] > current) {
      x[j + 1] = x[j];
      j--;
    }
    x[j + 1] = current;
  }
};
